function Support() {
   return (
      <div className="page page-centered">
         <h1>Техподдержка</h1>
         <p>
            Здесь появится форма обращения в поддержку. Пока это заглушка для
            будущей страницы.
         </p>
      </div>
   );
}

export default Support;
